import React from "react";
import Markdown from "markdown-to-jsx";
import { List, Typography } from '@material-ui/core';


const Contact = () => {
    return (
    <div>

        <h1>Kontaktuppgifter</h1>

        <Typography>
            <List>
                <ListItem>
                Mail: fredrik.fischer@protonmail.com
                </ListItem>
                <ListItem>
                Github: https://github.com/fredrikfischer
                </ListItem>
            </List>
        </Typography>
        
        
        
   
    </div>
    )
    
}

export {Contact}
